window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"22.0.0","implementation":{"name":"cucumber-jvm","version":"7.15.0"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"21.0.8+12-LTS-250"},"os":{"name":"Mac OS X"},"cpu":{"name":"aarch64"}}},{"testRunStarted":{"timestamp":{"seconds":1770738675,"nanos":782913000}}},{"source":{"uri":"file:///Users/origantisathish/Downloads/selenium-cucumber-framework/src/test/resources/features/Login.feature","data":"Feature: User Login Functionality\n  As a user of the SauceDemo application\n  I want to login with my credentials\n  So that I can access the product catalog\n\n  Background:\n    Given User navigates to the SauceDemo login page\n\n  @smoke @regression\n  Scenario: Successful login with valid credentials\n    When User enters username \"standard_user\"\n    And User enters password \"secret_sauce\"\n    And User clicks on login button\n    Then User should be redirected to products page\n    And User should see \"Products\" title\n\n  @regression\n  Scenario: Failed login with invalid username\n    When User enters username \"invalid_user\"\n    And User enters password \"secret_sauce\"\n    And User clicks on login button\n    Then User should see error message containing \"Username and password do not match\"\n    And User should remain on login page\n\n  @regression\n  Scenario: Failed login with invalid password\n    When User enters username \"standard_user\"\n    And User enters password \"wrong_password\"\n    And User clicks on login button\n    Then User should see error message containing \"Username and password do not match\"\n    And User should remain on login page\n\n  @regression\n  Scenario: Login with empty credentials\n    When User clicks on login button\n    Then User should see error message containing \"Username is required\"\n\n  @regression\n  Scenario: Login with locked user\n    When User enters username \"locked_out_user\"\n    And User enters password \"secret_sauce\"\n    And User clicks on login button\n    Then User should see error message containing \"this user has been locked out\"\n\n  @smoke @regression @dataDriven\n  Scenario Outline: Login with multiple user credentials\n    When User enters username \"<username>\"\n    And User enters password \"<password>\"\n    And User clicks on login button\n    Then User should see \"<result>\"\n\n    Examples:\n      | username                | password     | result                          |\n      | standard_user           | secret_sauce | Products                        |\n      | locked_out_user         | secret_sauce | locked out                      |\n      | problem_user            | secret_sauce | Products                        |\n      | performance_glitch_user | secret_sauce | Products                        |\n      | invalid_user            | secret_sauce | do not match                    |\n      | standard_user           | wrong_pass   | do not match                    |\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/origantisathish/Downloads/selenium-cucumber-framework/src/test/resources/features/Login.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"User Login Functionality","description":"  As a user of the SauceDemo application\n  I want to login with my credentials\n  So that I can access the product catalog","children":[{"background":{"location":{"line":6,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":7,"column":5},"keyword":"Given ","keywordType":"Context","text":"User navigates to the SauceDemo login page","id":"c89d916d-ff5f-4c6e-a3b8-c579b2b55308"}],"id":"780ef8b2-77d1-4b93-9c60-170e44ec6bdf"}},{"scenario":{"location":{"line":10,"column":3},"tags":[{"location":{"line":9,"column":3},"name":"@smoke","id":"9003e2e5-5a2c-41b8-b68b-0a593f0da1d4"},{"location":{"line":9,"column":10},"name":"@regression","id":"d4c67ebe-f539-4 As a logged-in user\n  I want to browse and add products to cart\n  So that I can purchase items\n\n  Background:\n    Given User is logged in to the application\n\n  @smoke @regression\n  Scenario: View all products on products page\n    Then User should see products page\n    And User should see at least 6 products displayed\n\n  @regression\n  Scenario: Add single product to cart\n    When User adds product \"Sauce Labs Backpack\" to cart\n    Then Shopping cart badge should show \"1\"\n\n  @regression\n  Scenario: Add multiple products to cart\n    When User adds product \"Sauce Labs Backpack\" to cart\n    And User adds product \"Sauce Labs Bike Light\" to cart\n    And User adds product \"Sauce Labs Bolt T-Shirt\" to cart\n    Then Shopping cart badge should show \"3\"\n\n  @regression\n  Scenario: Remove product from cart\n    Given User adds product \"Sauce Labs Backpack\" to cart\n    When User removes product \"Sauce Labs Backpack\" from cart\n    Then Shopping cart badge should not be displayed\n\n  @regression\n  Scenario: Verify product price\n    When User checks price of product \"Sauce Labs Backpack\"\n    Then Product price should be \"$29.99\"\n\n  @smoke @regression\n  Scenario: Sort products by price low to high\n    When User sorts products by \"Price (low to high)\"\n    Then Products should be sorted correctly\n\n  @regression\n  Scenario: User logout from products page\n    When User clicks on menu button\n    And User clicks on logout link\n    Then User should be redirected to login page\n\n  @e2e @regression\n  Scenario: Complete shopping flow - Add to cart and view cart\n    When User adds product \"Sauce Labs Backpack\" to cart\n    And User adds product \"Sauce Labs Bike Light\" to cart\n    And User clicks on shopping cart\n    Then User should see cart page with 2 items\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/origantisathish/Downloads/selenium-cucumber-framework/src/test/resources/feat
